// src/BorgesWatchmaker.js
import React from 'react';

const BorgesWatchmaker = () => {
  return (
    <div style={{ backgroundColor: '#1a3630', minHeight: '100vh', padding: '20px' }}>
      <h1 style={{ color: '#c9af8c' }}>Borges</h1>
      <h2 style={{ color: '#c9af8c' }}>O seu relojoeiro!</h2>
      <p style={{ color: 'white' }}>
        Descubra a excelência em consertos de relógio. Com mais de 60 
        anos de experiência atuando em Uberlândia e região.
      </p>
    </div>
  );
};

export default BorgesWatchmaker;
